// /src/components/LekarzList.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const LekarzList = () => {
  const [lekarze, setLekarze] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:8000/api/lekarze/');
        setLekarze(response.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h2>Lista Lekarzy</h2>
      <ul>
        {lekarze.map(lekarz => (
          <li key={lekarz.id}>{lekarz.imie} {lekarz.nazwisko} - {lekarz.specjalizacja}</li>
        ))}
      </ul>
    </div>
  );
};

export default LekarzList;
